import React from 'react';
import s from 'Stories.module.css'
import {StoriesType} from '../../../redux/news_reducer'

type PropsType = {
    story: StoriesType
}

const StoriesItem: React.FC<PropsType> = ({story}) => {


    return <div className={s.storiesItem}>
        <img src={story.photo} alt="Photo" className={s.storiesImg}/>
    </div>
}

export default StoriesItem
